import React from 'react';

const e = React.createElement;
const buttonStyle = {
    outline:'none'
}


class Button extends React.Component{

    render(){
        return e('button',{
            onClick:this.props.onClick,
            style:buttonStyle
        },
        this.props.label)
    }
}

export default Button;
